import React from 'react';
import { Card, CardContent, Typography, Box } from '@mui/material';
import SetMealIcon from '@mui/icons-material/SetMeal'; // Using SetMealIcon

function InfoCard({ title, description, bgColor, textColor }) {
  return (
    <Card sx={{ maxWidth: 345, margin: 2, backgroundColor: bgColor }}>
      <CardContent>
        <Box sx={{ display: 'flex', justifyContent: 'center', mb: 2, color: textColor }}>
          <SetMealIcon fontSize="large" />
        </Box>
        <Typography variant="h6" gutterBottom sx={{ color: textColor }}>
          {title}
        </Typography>
        <Typography variant="body2" color={textColor}>
          {description}
        </Typography>
      </CardContent>
    </Card>
  );
}

export default InfoCard;
